-- ************************************************************
-- Trevor note: I was uncertain whether we were to consider a logic check
--  definition as a schema or metadata change.  It is designed to be 
--  optional (like to metadata), but it currently is not one of our
--  tradional metadata tables (like viewproperty and list/listvalues).
--  Regardless, I place this here.  If a logic check is not desired, its
--  enabled property can be set to 0.

-- A logic check may have already been considered unused or undesired, in
-- which case its definition has been added, but it has been disabled.

-- After adding, the RecalculateLogicChecksController must be run in the
-- Lava front-end (see Admin module Actions bar) in order to activate the
-- check and perform on all existing entities.






-- deactivate all logic checks so that activation can occur, which recalculates all
--   logic checks on their pertinent entities
UPDATE logiccheck SET activeDate=NULL;
